import org.apache.spark.ml.regression.LinearRegression
import org.apache.spark.ml.linalg.Vectors

// Load training data
val data3D = spark.read.format("libsvm").load("file:///tmp/scatterData3D.txt")  // TODO: update to use HDFS once Spark 2.0 w/ Zep available on SandBox

// Initialize
val lr3D = new LinearRegression()
    .setMaxIter(10)
    .setRegParam(0.3)                   
    .setElasticNetParam(0.8)

// Fit the model
val lrModel3D = lr3D.fit(data3D)

// Print the coefficients and intercept for linear regression
println(s"Coefficients: ${lrModel3D.coefficients} Intercept: ${lrModel3D.intercept}")

// Summarize the model over the training set and print out some metrics

val trainingSummary3D = lrModel3D.summary
println(s"numIterations: ${trainingSummary3D.totalIterations}")
//println(s"objectiveHistory: ${trainingSummary3D.objectiveHistory.toList}")

println(s"Root Mean Square Error (RMSE): ${trainingSummary3D.rootMeanSquaredError}")
//println(s"r2: ${trainingSummary3D.r2}")
//trainingSummary.residuals.show()  // residuals

// Having a model we can also apply a 'transform' function directly to get
//   to have it return predicted values

// Build sample test DataFrame with points/features of interest
val testDataScatter3D = spark.createDataFrame(Seq(
  (1, Vectors.dense(1.0,1.0)),
  (2, Vectors.dense(2.0,2.0)),
  (3, Vectors.dense(3.0,3.0)),
  (4, Vectors.dense(4.0,4.0)),
  (5, Vectors.dense(5.0,5.0))
)).toDF("label", "features")

// Apply transform to get predicted model results
val predictions = lrModel3D.transform(testDataScatter3D)

predictions.select($"features", $"prediction" as "predicted").show()

